import React from "react";

const Pokemon = (props) => {
  const types = props.pokemon.types.map((type, index) => {
    <li key={index}>{type}</li>;
  });
  return (
    <>
      <article key={index}>
        <h4 className="title">{props.name}</h4>
        <img src={props.url} alt={props.name} />
        <ul>{types}</ul>
      </article>
    </>
  );
};
export default Pokemon;
